  // c_side.to_c2_set[type, 1, ALLOC]
  C.gg.resize(n1_gg);
  for (int i = 0; i < n1_gg; i++) gen_grad1_to_c(z_gg[i], C.gg[i]);

  // c_side.to_c2_set[integer, 0, NOT]
  C.ele_anchor_pt = z_ele_anchor_pt;
  // c_side.to_c2_set[integer, 0, NOT]
